let clockwise=true // Acts as a switch (if true: go anticlockwise, if false: go clockwise)

setInterval(()=>{ // Starts intervals
    if(clockwise){
    feature.rotation.y = feature.rotation.y + 15 // move anticlockwise
    clockwise = !clockwise
  }else{
    feature.rotation.y = feature.rotation.y - 15 // move clockwise
    clockwise = !clockwise
  }
},1500)

let clockwise=true // Acts as a switch (if true: go anticlockwise, if false: go clockwise)

setInterval(()=>{ // Starts intervals
    if(clockwise){
    feature.rotation.y = feature.rotation.y + 3 // move anticlockwise
    clockwise = !clockwise
  }else{
    feature.rotation.y = feature.rotation.y - 4 // move clockwise
    clockwise = !clockwise
  }
},1100)
